State gives sentencing arguments.  Victim's parents spoke.
Attorney Benedict gives sentencing arguments.
Defendant makes statements to the court. 
Letter of apology by defendant to victime is to be can be given to the District Attorneys office and family to determine if they want to accept the letter. 

