  -  7 YEARS OF EXTENDED SUPERVISION;

CONDITIONS OF EXTENDED SUPERVISION:
*Follow through with any assessments, treatment and/or counseling recommended by Agent including sex offender treatment;
*No contact with: victim or family members;lly explicit materials.
